import React from "react";
import Header from '../components/Header';
import MainPostR from '../components/MainPostR';
import Footer from '../components/Footer';

const PostR=()=> {
  return (
    <div id="page-wrapper">
      <Header />
      <MainPostR />
      <Footer />
    </div>
  )
}
export default PostR;
